import React, {Component} from 'react';
import {Pie} from 'react-chartjs-2';

//pie chart style and details 
export default class PieChart extends Component{
    constructor(props){
        super(props);
        this.state = {
            pieChartData:props.pieChartData
        }
    }
    render(){
        return(
            <div className='chart'>
                <Pie
                data = {this.state.pieChartData} 
                />
            </div>
        )
    }
}
